import styled from 'styled-components'

const Icon = styled.div`
  width: 60px;
  flex: 1 1 auto;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  cursor: pointer;
  min-width: 40px;

  img {
    width: 40px;
  }

  svg {
    width: 40px;
  }
`

export default Icon
